def main():
    import re
    import csv

    # ここを設定
    version = "hisui"
    html = hisui_html


    # ポケモン名リンクを「href="./zukan/n数字(任意の英字)*"」で限定
    #    例： href="./zukan/n745" , href="./zukan/n745f" , href="./zukan/n74a" など
    # さらに、図鑑番号は <td class="c1">数字</td> でキャプチャ
    pattern = re.compile(
        r'<td[^>]*class=["\']c1["\'][^>]*>(\d+)</td>'  # 図鑑番号
        r'.*?'  # 任意の文字(改行含む)
        r'<a[^>]*href=["\']\.\/zukan\/n\d+[a-z]*["\'][^>]*>(.*?)</a>',  # ポケモン名リンク
        re.DOTALL
    )

    matches = pattern.findall(html)

    # 抽出結果を確認
    for match in matches:
        print(match)

    # CSVに出力する例
    with open('pokemon.csv', 'w', newline='', encoding='utf-8') as f:
        writer = csv.writer(f)
        writer.writerow(["図鑑番号", "ポケモン名"])
        # matches には「(図鑑番号, リンクテキスト全体)」を得たいが
        # 今回の正規表現は (図鑑番号)(リンクテキスト) になっているので
        # それぞれ別々に取り出すには再度パターンを工夫するか2段階にする
        #
        # 例：先にすべて取っておいてループで書き出し
        # ただし今のpatternだとグループが1つ余分にないので、
        # 連番＋名前を同時にキャプチャするには少し修正が必要。
        # ここではシンプルに例示します。

    # 正しく2つのキャプチャに分けるなら、こんな形にする：
    pattern2 = re.compile(
        r'<td[^>]*class=["\']c1["\'][^>]*>(\d+)</td>'
        r'.*?'
        r'<a[^>]*href=["\']\.\/zukan\/n\d+[a-z]*["\'][^>]*>(.*?)</a>',
        re.DOTALL
    )

    results = pattern2.findall(html)

    with open(f'pokemon_{version}.csv', 'w', newline='', encoding='utf-8') as f:
        writer = csv.writer(f)
        writer.writerow(["図鑑番号", "ポケモン名"])
        for dex_no, name_html in results:
            # name_html にはタグが入る可能性（<br>や<span>など）もあるため、
            # タグを消してテキスト化したい場合は以下のように処理
            # 例：HTMLタグを雑に消す
            name_text = re.sub(r'<.*?>', '', name_html)
            # 改行や空白を整える
            name_text = name_text.strip()

            writer.writerow([dex_no, name_text])

    print("抽出完了しました。")


if __name__ == "__main__":
    main()
